import React, { useContext } from "react";
import { BrowserRouter as Router, Switch, Route, Redirect } from "react-router-dom";

import "./App.css";
import AuthContext from "./store/auth-context";

import ListReportComponent from "./components/Report/ListReportComponent";
import CreateReportComponent from "./components/Report/CreateReportComponent";
import UpdateReportComponent from "./components/Report/UpdateReportComponent";
import ViewReportComponent from "./components/Report/ViewReportComponent";

import ListRouteComponent from "./components/Route/ListRouteComponent";
import CreateRouteComponent from "./components/Route/CreateRouteComponent";
import UpdateRouteComponent from "./components/Route/UpdateRouteComponent";
import ViewRouteComponent from "./components/Route/ViewRouteComponent";

import ListFeedbackComponent from "./components/Feedback/ListFeedbackComponent";
import CreateFeedbackComponent from "./components/Feedback/CreateFeedbackComponent";
import UpdateFeedbackComponent from "./components/Feedback/UpdateFeedbackComponent";
import ViewFeedbackComponent from "./components/Feedback/ViewFeedbackComponent";

import ListBookingComponent from "./components/Booking/ListBookingComponent";
import CreateBookingComponent from "./components/Booking/CreateBookingComponent";
import UpdateBookingComponent from "./components/Booking/UpdateBookingComponent";
import ViewBookingComponent from "./components/Booking/ViewBookingComponent";

import LoginForm from "./components/User/LoginForm";
import RegistrationForm from "./components/User/RegistrationForm";

import MainNavigation from "./components/Layout/MainNavigation";
import FooterComponent from "./components/Layout/FooterComponent";
import LandingPage from "./components/Layout/LandingPage";

function App() {
  const authCtx = useContext(AuthContext);
  const isAdmin = authCtx.token === "admin";
  return (
    <div>
      <Router>
        <div>
          <MainNavigation />
          <div>
            <Switch>
              <Route exact path="/" component={LandingPage}></Route>
              <div className="container">

                {!authCtx.isLoggedIn && <Route path="/auth" component={LoginForm}></Route>}
                {!authCtx.isLoggedIn && <Route path="/signup" component={RegistrationForm}></Route>}

                <Route path="/reports">
                  {authCtx.isLoggedIn && isAdmin && <ListReportComponent />}
                  {authCtx.isLoggedIn && !isAdmin && <p>You do not have enough privileges to access this page!!</p>}
                  {!authCtx.isLoggedIn && <Redirect to="/auth" />}
                </Route>
                {authCtx.isLoggedIn && isAdmin && (
                  <>
                    <Route path="/add-report" component={CreateReportComponent}></Route>
                    <Route path="/update-report" component={UpdateReportComponent}></Route>
                    <Route path="/view-report/:id" component={ViewReportComponent}></Route>
                  </>
                )}

                <Route path="/routes">
                  {authCtx.isLoggedIn && <ListRouteComponent />}
                  {!authCtx.isLoggedIn && <Redirect to="/auth" />}
                </Route>
                {authCtx.isLoggedIn && (
                  <>
                    <Route path="/add-route" component={CreateRouteComponent}></Route>
                    <Route path="/update-route" component={UpdateRouteComponent}></Route>
                    <Route path="/view-route/:id" component={ViewRouteComponent}></Route>
                  </>
                )}

                <Route path="/feedbacks">
                  {authCtx.isLoggedIn && <ListFeedbackComponent />}
                  {!authCtx.isLoggedIn && <Redirect to="/auth" />}
                </Route>
                {authCtx.isLoggedIn && (
                  <>
                    <Route path="/add-feedback" component={CreateFeedbackComponent}></Route>
                    <Route path="/update-feedback" component={UpdateFeedbackComponent}></Route>
                    <Route path="/view-feedback/:id" component={ViewFeedbackComponent}></Route>
                  </>
                )}

                <Route path="/bookings" component={ListBookingComponent}></Route>
                <Route path="/add-booking" component={CreateBookingComponent}></Route>
                <Route path="/update-booking" component={UpdateBookingComponent}></Route>
                <Route path="/view-booking/:id" component={ViewBookingComponent}></Route>
                <Route path="*"><Redirect to="/" /></Route>
              </div>
            </Switch>
          </div>
          <FooterComponent />
        </div>
      </Router>
    </div>
  );
}

export default App;
